import React from 'react';
import Todo from './Todo';

export default function TodoList ({todos = [], toggleTodo}) {
    return (
        <div>
            {todos.map((t, i) => (
                <Todo 
                    {...t} 
                    key={'todo-' + i} 
                    toggleTodo={() => toggleTodo(i)} 
                />
            ))}
        </div>
    );
}
